import React, { useState } from 'react';
import './App.css';

function App() {
  const [isDay, setIsDay] = useState(true);

  const toggleDayNight = () => {
    setIsDay(!isDay);
  }

  return (
    <div className={`app ${isDay ? 'day' : 'night'}`}>
      <div className="planet"></div>
      <button onClick={toggleDayNight}>{isDay ? 'Ночь' : 'День'}</button>
    </div>
  );
}

export default App;
